            "id": 4,
            "text_id_1": 41,
            "text_id_2": 45,
            "text_id_3": 49,
            "degree": 4,
            "description": "4.2.3° Wanneer een bevoegd persoon zwaait met een rood licht, moeten de weggebruikers stoppen wanneer het rode licht naar hen gericht is"
