            "text_id_2": 42,
            "text_id_3": 46,
            "degree": 1,
            "description": "7.1 Je mag geen kwetsbare weggebruikers in gevaar brengen en moet dubbel voorzichtig zijn in de buurt van fietsers, voetgangers, kinderen, bejaarden of andersvaliden"
