            "text_id_1": 38,
            "text_id_2": 42,
            "text_id_3": 46,
            "degree": 1,
            "description": "7.2 Je mag geen gevaar veroorzaken aan andere weggebruikers, daarin inbegrepen het personeel van wegenwerken"
