            "text_id_1": 38,
            "text_id_2": 42,
            "text_id_3": 46,
            "degree": 1,
            "description": "9.3.1. Je moet steeds zo dicht mogelijk bij de rechterrand van de rijbaan rijden, behalve op pleinen, op plaatsen waar je mag/moet voorsorteren of op rotondes. Wie heeft voorgesorteerd, moet daarna wel zo snel mogelijk weer rechts gaan rijden."
