            "text_id_1": 39,
            "text_id_2": 43,
            "text_id_3": 47,
            "degree": 2,
            "description": "12.3.1 Je moet voorrang verlenen aan wie van rechts komt, behalve op een rotonde, wanneer de ander uit een verboden richting komt of wanneer een verkeersbord een andere voorrangsregeling oplegt"
