            "description": "17.2.5° Het is verboden links in te halen wanneer het in te halen voertuig stopt voor een oversteekplaats of in de buurt van oversteekplaatsen waar het verkeer niet wordt geregeld door een bevoegd persoon of door verkeerslichten."
