            "text_id_2": 42,
            "text_id_3": 46,
            "degree": 1,
            "description": "33.2 Je mag enkel claxonneren om een ongeval te voorkomen. Buiten de bebouwde kom mag je enkel claxonneren om een ander te waarschuwen dat je hem gaat inhalen"
