            "text_id_1": 38,
            "text_id_2": 42,
            "text_id_3": 46,
            "degree": 1,
            "description": "37.4 Wanneer de sirene wordt gebruikt, mag een prioritair voertuig door rood, maar enkel nadat het is gestopt en op voorwaarde dat de andere weggebruikers niet in gevaar worden gebracht"
