            "text_id_1": 40,
            "text_id_2": 44,
            "text_id_3": 48,
            "degree": 3,
            "description": "38 Wanneer een prioritair voertuig de sirene gebruikt, moet je onmiddellijk de doorgang vrijmaken en voorrang verlenen. Indien nodig moet je stoppen."
