            "description": "51.1 De bestuurder van een defect voertuig mag de veiligheid en vlotheid van het andere verkeer niet hinderen. Je moet het defecte voertuig achterlaten zoals een geparkeerd voertuig. Als dit onmogelijk is, moet de gevarendriehoek worden geplaatst. De vier richtingaanwijzers of een draagbaar geel knipperlicht mogen ook worden gebruikt. Wanneer de lichten van de auto of de aanhangwagen niet meer werken, moet deze ook worden gesignaleerd met een gevarendriehoek, de vier richtingaanwijzers of een draagbaar geel knipperlicht."
