            "description": "52.3. Ben je betrokken bij een ongeval met lichamelijke schade, dan moet je hulp verlenen indien nodig, je identiteitskaart tonen aan wie erom vraagt en ter plaatse blijven voor de nodige vaststellingen. Wanneer je de plaats van het ongeval verlaat om hulp te verlenen of de politie te verwittigen, moet je je naam en adres meedelen aan één van de aanwezigen. Wanneer er geen bevoegd persoon ter plaatse kan komen binnen een redelijke termijn, moet je binnen de 24 u aangifte doen aan de politie."
